- input: "TEXT\x1CC00398826\x1C.TEXT\x1C\x1CF3XA\x1CWe received a letter from the
    Federal Election Commission dated February 19, 2010 regarding potential excessive
    contributions made to the Bennet for Colorado campaign committee (Senator Michael
    Bennet from Colorado) during 2009.  I spoke with a representative from this committee
    on March 18, 2010, and found out that they designated $5,000 of our total $7,500
    contributions made in 2009 for the primary election and the remaining $2,500 of
    our contributions for the general election.  Therefore, this report is being amended
    to redesignate the total of $3,500 of contributions made during this period to
    the Bennet for Colorado campaign committee (originally reported for the primary
    election) as being $1,000 for the primary election and $2,500 for the general
    election.  Please call me at (505) 468-4101 if you have any questions regarding
    this amendment.\n"
